import React from 'react';
import { Route, BrowserRouter } from 'react-router-dom';
import './App.css';
import Header from './components/Header/Header'
import LeftMenu from './components/LeftMenu/LeftMenu';
import Profile from './components/Profile/Profile';
import Messages from './components/Messages/Messages';
import News from './components/News/News';
import Music from './components/Music/Music';
import Settings from './components/Settings/Settings';

const SocialNetworkSite = (props) => {
  let postsData = [
    {id: 1, text: 'Hello! How are you?', likes: 3 },
    {id: 2, text: 'My name is Kirill!', likes: 8 },
    {id: 3, text: 'Good life', likes: 5 }
  ];
  return (
    <BrowserRouter>
      <div className='SNsite'>
        <Header />
        <LeftMenu/>
        <Route path='/profile'><Profile postsData={postsData} /></Route>
        <Route path='/messages'><Messages/></Route>
        <Route path='/news'><News/></Route>
        <Route path='/music'><Music/></Route>
        <Route path='/settings'><Settings/></Route>
      </div>
    </BrowserRouter>  
  );
}

export default SocialNetworkSite;
